import React from "react";
import about from "./about.css";
import propic from './propic.jpg';
const About = () => {
  return (
    <div className="jumbotron">
      <img className="img-fluid" src="{propic}"/>
      <h2 className="display-7">Md Shahriar Rahman</h2>
      <p className="lead">
        I am a software developer experienced in various programming languages and frameworks.
        Welcome to my portfolio.
      </p>
      <hr className="my-4" />
    </div>
  );
};

export default About;
